import { Component, Input} from '@angular/core';

@Component({
  selector: 'app-parental-data',
  templateUrl: './parental-data.component.html',
  styleUrls: ['./parental-data.component.css']
})
export class ParentalDataComponent {
 @Input() name!: String
 @Input() date!: {email: String, senha: String, idade: Number}

}
<h1>User:</h1>
<p>Nome: {{ name }}</p>
<p>Email: {{ date.email }}</p>
<p>Senha: {{ date.senha }}</p>
<p>Idade: {{ date.idade }}</p>
